import { Link } from "react-router-dom";

export function Existing() {
  return (
    <div>
      <form>
        <input type="text" placeholder="Enter ID" />
        <button>Search</button>
      </form>
      <Link to={"/"}>
        <button>Back</button>
      </Link>
    </div>
  );
}
